import React from 'react';

import {
    Animated
} from "react-animated-css";

import PopUpTest from './PopUpTest';


export default class CardTest extends React.Component {
    render() {
        return (
            <div className="col-12 col-md-6 col-lg-4 padding-top-bottom-companies">
                 <PopUpTest
                     {...this.props}
                     company={this.props.name}
                 />
            </div>

        );
    }
}
